<script>
function addLocateButton(map){
  const btn = L.control({position: 'bottomright'});
  btn.onAdd = function(){
    const div = L.DomUtil.create('div', 'leaflet-bar leaflet-control leaflet-control-custom');
    div.innerHTML = 'ğŸ“<br><small style="font-size:10px;">Min plats</small>';
    div.style.backgroundColor = 'white';
    div.style.cursor = 'pointer';
    div.style.textAlign = 'center';
    div.style.padding = '4px';
    div.title = 'Visa min plats';
    div.onclick = function(){
      if (navigator.geolocation){
        navigator.geolocation.getCurrentPosition(
          function(pos){
            const lat = pos.coords.latitude;
            const lon = pos.coords.longitude;
            const userMarker = L.marker([lat, lon], {
              icon: L.icon({
                iconUrl: 'https://cdn-icons-png.flaticon.com/512/64/64113.png',
                iconSize: [24, 24]
              })
            }).addTo(map);
            userMarker.bindPopup('ğŸ“ Du Ã¤r hÃ¤r!<br><b>Lat:</b> '+lat.toFixed(5)+'<br><b>Lon:</b> '+lon.toFixed(5)).openPopup();
            map.setView([lat, lon], 14);
          },
          function(err){ alert('Kunde inte hÃ¤mta position: ' + err.message); }
        );
      } else {
        alert('Geolocation stÃ¶ds inte av din webblÃ¤sare.');
      }
    };
    return div;
  };
  btn.addTo(map);
}
setTimeout(function() {
  for (const key in window) {
    if (key.startsWith("map_")) {
      addLocateButton(window[key]);
      break;
    }
  }
}, 500);
</script>
